import React from 'react';
import List from './List';
import './styles.css';

function App() {
  const data = [
    {
      id: 1,
      todo: "Call mom",
      completed:false,
    },
    {
      id: 2,
      todo: "Eat lunch",
      completed: false,
    }
  ]

  return (
    <List data={data} filterType="showCompleted"/>
  );
}

export default App;
